erdeel is inzicht te verschaffen in de beginselen van de economie. Met het oog op het voorbereiden van de student op de toetreding tot de arbeidsmarkt, wordt uitvoerig aandacht besteed aan de micro-economische aspecten van de economie. Wat de macro-economie betreft, legt de cursus vooral de nadruk op economische indicatoren; geaggregeerde vraag en geaggregeerd aanbod; het meten en interpreteren van de macro-economische activiteit; en het belang van economische politiek en institutionele aspecten voor het bedrijfsleven. De topics zijn:\n        De beginselen van de economie\n        De markt: vraag en aanbod\n        Elasticiteit\n        Toepassingen van vraag en aanbod\n        Kosten en opbrengsten van de onderneming\n        Marktvormen\n        Marktverstoringen en overheidsbeleid\n        Inleiding tot de macro-economie\n        Meten van economische activiteit\n        Output-bestedingsmodel en fiscaal beleid\n        Geld, bankwezen en monetair beleid\n        Geaggregeerde vraag, geaggregeerd aanbod en inflatie\n        Wisselkoersen','0025867',41,0),('1001720BNR','Gedistribueerde systemen\r',NULL,'0067395',37,0),('1001725BNR','Gedistribueerde systemen\r',NULL,'0067395',37,0),('1001812ANR','Cartografie\r',NULL,'0013005',20,0),('1001815ANR','Cartografie\r',NULL,'0013005',20,0),('1002033BNR','Analytische (bio)chemie\r',NULL,'0006288',34,0),('1002079CNW','Machine Learning\r',NULL,'0033601',37,0),('1002080CNR','Machine Learning\r',NULL,'0033601',37,0),('1002163CNR','Functionele plantkunde\r',NULL,'0009424',35,0),('1002196BNR','Struct v compprogramma\'s II\r',NULL,'0067408',37,0),('1002198BNR','Struct v compprogramma\'s II\r',NULL,'0067408',37,0),('1003822ANR','Fysische geografie\r',NULL,'0000595',20,0),('1003854BNR','Colloïdchemie\r',NULL,'1002162',26,0),('1003956BNR','Klimatologie en oceanografie\r',NULL,'0017419',20,0),('1003975CNR','Topografie en geodesie\r',NULL,'0017419',20,0),('1003981BNR','Kwantumfysica\r',NULL,'1000324',22,0),('1004120ANR','Sociale Geogr